    let counter = 1
    const element = props.projects.map(project => {
        let classID = ""
        if(counter%2===1){
            classID = "project-even";
        } else {
            classID = "project-odd";
        }

        switch(classID){
            case("project-even"):
                <li>{project}</li>

        }
    })
    return(<ul className="workHistory">{element}</ul>);
}
